import React from 'react'
import Navbar from '../components/Navbar'

const SignupPage = () => {
  const topics = [
    {
      id:1,
      text: 'Stories',
    },
    {
      id:2,
      text: 'Opinions',
    },
    {
      id:3,
      text: 'Investigations',
    },
    {
      id:4,
      text: 'Mission Statement'
    }
  ]

  return (
    <Navbar topics={topics}></Navbar>
  )
}

export default SignupPage
